// import Video from "./components/video";
const Mvideo = () => {
  const width = window.innerWidth;
  function call() {
    if (width > 500) {
      return <h1>more than 500</h1>;
    } else {
      return <h1>Open In Mx player</h1>;
    }
  }
  return call();
};

export default Mvideo;
